import { Link } from 'react-router-dom'; 
import './All.css';
import React, {useEffect, useState } from "react";
import Axios from "axios";

function All() {
    const [data, setUserList] = useState([]);

    const getuser = async () => {
        try {
            const response = await Axios.get("http://localhost:3002/details");
            return response.data.users;
        } catch (error) {
            console.error("fetching error", error);
        }
    };

    useEffect(() => {
        getuser().then(setUserList);
    }, []);

    return (
        <div className="app-container">
            {/* Sidebar */}
            <div className="sidebar">
                <ul>
                    <li><Link to="/">Add</Link></li>
                    <hr className="sidebar-line" />
                    <li><a href="#update">Update</a></li>
                    <hr className="sidebar-line" />
                    <li><Link to="/">All</Link></li>
                </ul>
            </div>

            {/* Main content area */}
            <div className="main-content">
                <div className='box'>
                    <table border="1" style={{ width: "100%", margin: "auto", textAlign: "left" }}>
                        <thead>
                            <tr>
                                <th>districts</th>
                                <th>stream</th>
                                <th>course</th>
                                <th>zvalue1</th>
                                <th>zvalue2</th>
                                <th>action</th>
                            </tr>
                        </thead>
                        <tbody>
                            {data.map((row) => (
                                <tr key={row.id}>
                                    <td>{row.district}</td>
                                    <td>{row.stream}</td>
                                    <td>{row.course}</td>
                                    <td>{row.zValue1}</td>
                                    <td>{row.zValue2}</td>
                                    <td>
                                        <button>Update</button>{" "}
                                        <button>Delete</button>
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    );
}

export default All;
